// Latihan

// bermasalah tanpa async await

function fetchData() {
    let data = []
    
    let res = fetch("https://jsonplaceholder.typicode.com/users") 
    
    data = res 

    console.log(res)
}

// dengan async await 
async function fetchDataDenganAsync() {
    let data = []
    
    let res = await fetch("https://jsonplaceholder.typicode.com/users") 
    res = await res.json()

    data = res 

    console.log(res)
}

fetchData()
fetchDataDenganAsync()